import React,{useEffect} from 'react'
import Component1 from './home/component1';
import Component2 from './home/component2';

const Home=(props)=>{
    useEffect(() => {
        window.scrollTo(0, 0)
      }, [])
    return(
        <>
            <Component1/>
            <Component2/>
        </>
    )
}
export default Home;
